    // return true if the pack is supposed to be lock. This should take into account whether it is unlocked by
    // user already or not
    public static boolean isPackLocked(int levelDifficulty, String packName, Context context) {
        String [] arr = null;
        switch (levelDifficulty) {
            case Constants.EASY_MODE:
                arr = lockedPack_Easy;
                break;
            case Constants.MEDIUM_MODE:
                arr = lockedPack_Medium;
                break;
            case Constants.HARD_MODE:
                arr = lockedPack_Hard;
                break;
            case Constants.INSANE_MODE:
                arr = lockedPack_Insane;
                break;
            default: arr = lockedPack_Easy; // should not be called
        }

        for(String current : arr) {
            if(packName.equals(current)) {
                // was supposed to be lock by default.
                // But now we check if user has unlocked before ornot
                if(Utils.getIfPackWasUnlock(context, levelDifficulty, packName)) {
                    // unlocked before, therefore return false
                    return false;
                }

                // didnt unlock before, hence this pack should be locked
                return true;
            }
        }
        return false;
    }

